INSERT INTO `article` VALUES ('2022-01-30 10:05:04','5 книг, которые можно прочитать за день','blog_images/post1.jpg','Когда вокруг - сплошной информационный шум, хочется выключить смартфон и с головой окунуться в какую-то увлекательную историю. Именно такие книги мы для вас и выбрали, а еще - их можно прочитать за один день (а то и вечер).'),('2022-04-14 11:06:25','Книжные новинки ноября 2021','blog_images/post2.jpg','Последний месяц осени – это время, когда множество издательств презентуют свои новинки, которые могут стать прекрасными подарками под елку для ваших близких. Ноябрь 2021 – не исключение. Мы собрали для вас подборку только из лучших историй, которые вы непременно сможете подарить друзьям или самому себе на зимние праздники. От биографии до серии детских книг – каждый найдет что-нибудь для себя!');
