INSERT INTO `book` VALUES (1,'В потоке. Движение к счастью','Эмоциональная зрелость: источник внутренней силы','Эксмо',2021,240,'16+','Вы наверняка встречали словосочетание \"эмоциональный интеллект\". О нём написано много книг, создано не меньше образовательных курсов. Развивать эмоциональный интеллект очень важно, но это лишь первая ступень. Вторая — это эмоциональная зрелость. Что значит быть эмоционально зрелым человеком? Это значит научиться управлять своими эмоциями, сделать их своими союзниками и не позволять им взять над собой власть.В основу книги этой книги лёг одноименный курс Вании Маркович — основательницы Школы осознанной жизни \"Симург\" и Международной Академии Расстановок, автора курсов по эмоциональному интеллекту, бесконфликтному общению и экологии отношений, посла Мира в Международной Федерации за Мир при ООН. Вания помогла тысячам людей прийти к эмоциональной зрелости. Теперь и у вас есть уникальная возможность перейти на новый уровень жизни, ведь от наших эмоций зависит буквально все: отношения с людьми, ощущение внутренней гармонии, успех в работе и наше здоровье.В книге рассматриваются 20 черт характера, которые есть у всех нас, но в разных комбинациях. Именно они мешают нам жить, выстраивать гармоничные отношения, добиваться поставленных целей и быть счастливыми. Откуда берутся черты? Как их распознать? А самое главное — как их трансформировать, чтобы они стали нашей силой, а не слабостью? Все материальные изменения, которые происходили с учениками Вании, — это следствие внутренних трансформаций.','Саморазвитие','В наличии',150),(2,'Книги, которые нужно прочитать до 35 лет','НЕ НОЙ. Только тот, кто перестал сетовать на судьбу, может стать богатым','Форс',2019,304,'16+','\"Если даже такая нищебродская тушка, как я сумела поправить свое финансовое положение, сможет кто угодно!\" - заявляет Джен Синсеро. И ей сложно не верить. До сорока с лишнем лет она жила в переделанном гараже, одевалась в секонд-хэнде и не могла себе позволить вылечить зубы. Сейчас Джен путешествует по всему миру, останавливаясь только в пятизвездочных отелях. Ее книга – это квинтэссенция методик и стратегий по перенастройке финансового мышления. Она не только снимает психологические блоки на пути к достойному доходу, но и отвешивает энергетический пинок, который придает сил для достижения самых смелых целей.','Саморазвитие','В наличии',125),(3,'-','Ясно, понятно. Как доносить мысли и убеждать людей с помощью слов','Альпіна Паблішер Україна',2021,448,'12+','Эта книга о правильной и понятной коммуникации: как с помощью слов доносить свои мысли и влиять на людей.Максим Ильяхов развивает тему, затронутую в бестселлере «Пиши, сокращай». Вы узнаете, как привлечь внимание читателей, как помочь им понять и принять точку зрения автора, как увлекательно и доступно раскрыть любую тему, даже самую сложную.Вы найдете в книге более 50 инструментов улучшения текста. В разделе «Контекст» автор покажет, как справиться с предвзятостью читателей и настроить их на верное восприятие информации. В разделе «Интерес» – как превратить скучный текст в увлекательный, не меняя его содержания. Раздел «Текст» посвящен использованию примеров, антипримеров, аналогий, метафор, сюжетности и слоганов – тому, что поможет адресату правильно понять написанное вами. В разделе «Подача» представлены инструменты мгновенного воздействия: как донести главное заголовком, схемой или фотографией. Максим Ильяхов рассказывает о создании сильного текста, подкрепляя теорию примерами из собственной практики.Книга адресована всем, кто уже умеет писать и сокращать, но хочет делать это лучше – так, чтобы не только информировать, но и убеждать словом, – копирайтерам, маркетологам, бизнес-тренерам, предпринимателям и блогерам.','Учебная литература','В наличии',220),(4,'-','Тренажер мозга. Как развить гибкость мышления за 40 дней','Альпіна Паблішер Україна',2020,192,'16+','Вы — это ваш мозг. Ваш мозг обладает невероятным потенциалом, и пришла пора раскрыть его в полной мере. Простые упражнения, основанные на современных научных исследованиях, помогут вам эффективнее использовать свои врожденные способности. Вы научитесь принимать более правильные решения, быстрее и эффективнее думать. Эта программа упражнений поможет справиться с нервным напряжением, повысить работоспособность и развить гибкость мышления. Тренируйтесь каждый день, и уже через 40 дней вы увидите результат. Издание дополнено серией специально разработанных игр для тренировки мозга, так что вы можете сразу же применить описанные методы на практике.','Саморазвитие','В наличии',95),(5,'Главный триллер года','Безмолвный пациент','Форс',2019,352,'16+','Жизнь Алисии Беренсон кажется идеальной. Известная художница вышла замуж за востребованного модного фотографа. Она живет в одном из самых привлекательных и дорогих районов Лондона, в роскошном доме с большими окнами, выходящими в парк. Однажды поздним вечером, когда ее муж Габриэль возвращается домой с очередной съемки, Алисия пять раз стреляет ему в лицо. И с тех пор не произносит ни слова.\r\nОтказ Алисии говорить или давать какие-либо объяснения будоражит общественное воображение. Тайна делает художницу знаменитой. И в то время как сама она находится на принудительном лечении, цена ее последней работы – автопортрета с единственной надписью по-гречески «АЛКЕСТА» – стремительно растет.\r\nТео Фабер – криминальный психотерапевт. Он долго ждал возможности поработать с Алисией, заставить ее говорить. Но что скрывается за его одержимостью безумной мужеубийцей и к чему приведут все эти психологические эксперименты? Возможно, к истине, которая угрожает поглотить и его самого…','Художественная литература','В наличии',190),(6,'-','Женщина, у которой есть план: правила счастливой жизни','Форс',2020,208,'16+','71-летняя супермодель Мэй Маск – не просто красивая, но и невероятно успешная и счастливая женщина – делится мудрыми уроками, которые она усвоила за долгую жизнь. Несмотря на удары судьбы и невзгоды: развод и статус многодетной матери-одиночки в 31 год, бедность и невостребованность, Мэй никогда не опускала руки. Она упорно работала, боролась с жесткими стандартами в модной индустрии, воспитывала в детях независимость и амбициозность – и всегда смотрела в будущее с оптимизмом, имела четкий план действий и знала, куда и зачем идет.\r\nВ своей первой книге Маск не только рассказывает историю своей богатой приключениями жизни, но и с удовольствием дает множество полезных советов о том, как сохранить здоровье и красоту, быть стильной и уверенной, оставаться хорошей матерью и при этом строить карьеру, а главное – принимать себя, не бояться пробовать новое и любить жизнь в любом возрасте.','Биографии, мемуары','В наличии',290),(7,'-','Короткий курс історії України','А-ба-ба-га-ла-ма-га',2017,464,'12+','Історія грає серйозну роль у сучасності. Вона підносить нам цінні уроки та допомагає зрозуміти причини явищ нашого часу. Щоб дати зрозуміти яким було життя українського народу з давніх часів, була написана книга «Короткий курс історії України». Це своєрідний підручник з історії України, що розповість про її перемоги та поразки, ворогів та героїв, стійкість духу її народу та спроби його підкорити.','Учебная литература','В наличии',115),(8,'Big Ideas','Sapiens. Краткая история человечества','Синдбад',2016,512,'16+','Сто тысяч лет назад Homo sapiens был одним из как минимум шести видов человека, живших на этой планете, - ничем не примечательным животным, которое играло в экосистеме роль не большую, чем гориллы, светлячки или медузы. Но около семидесяти тысяч лет назад загадочное изменение когнитивных способностей Homo sapiens превратило его в хозяина планеты и кошмар экосистемы. Как человек разумный сумел покорить мир? Что стало с другими видами человека? Когда и почему появились деньги, государства и религия? Как возникали и рушились империи? Почему почти все общества ставили женщин ниже мужчин? Как наука и капитализм стали господствующими вероучениями современной эры? Становились ли люди с течением времени счастливее? Какое будущее нас ожидает? Юваль Харари показывает, как ход истории формировал человеческое общество и действительность вокруг него. Его книга прослеживает связь между событиями прошлого и проблемами современности и заставляет читателя пересмотреть все устоявшиеся представления об окружающем мире.','Научно-популярная литература','В наличии',380),(10,'-','Убийство в \"Восточном экспрессе\"','Эксмо',2016,320,'16+','Самый знаменитый роман Агаты Кристи! Находившийся в Стамбуле великий сыщик Эркюль Пуаро возвращается в Англию на знаменитом \"Восточном экспрессе\", в котором вместе с ним едут, кажется, представители всех возможных национальностей. Один из пассажиров, неприятный американец по фамилии Рэтчетт, предлагает Пуаро стать своим телохранителем, поскольку считает, что его должны убить. Знаменитый бельгиец отмахивается от этой абсурдной просьбы. А на следующий день американца находят мертвым в своем купе, причем двери закрыты, а окно открыто. Пуаро немедленно берется за расследование – и выясняет, что купе полно всевозможных улик, указывающих… практически на всех пассажиров \"Восточного экспресса\". Вдобавок поезд наглухо застревает в снежных заносах в безлюдном месте. Пуаро необходимо найти убийцу до того, как экспресс продолжит свой путь…','Художественная литература','В наличии',235),(11,'Король на все времена','Как писать книги','АСТ',2021,320,'18+','Это, пожалуй, самая необычная из книг Стивена Кинга. Книга, в которой автобиографические, мемуарные мотивы соседствуют не только с размышлениями о писательском искусстве вообще, но и с самыми настоящими &laquo;профессиональными советами тем, кто хочет писать как Стивен Кинг&raquo;.  Как формируется писатель? Каковы главные &laquo;секреты&raquo; его нелегкого &laquo;ремесла&raquo;? Что вообще необходимо знать и уметь человеку, чтобы его творения возглавляли международные списки бестселлеров?  Вот лишь немногие из вопросов, на которые вы найдете ответы в этой книге. Вы действительно хотите писать как Стивен Кинг? Тогда не пропустите эту книгу.','Биографии, мемуары','В наличии',200),(12,'-','Кратчайшая история времени','АСТ',2021,176,'18+','Кратчайшая история времени - больше, чем пространный комментарий к сложным понятиям и теориям, описанным в легендарной Краткой истории. Авторы, Стивен Хокинг и Леонард Млодинов, спустя 17 лет, многое поменявших в астрофизике, новым взглядом смотрят на извечные вопросы: о природе пространства и времени, роли Бога в сотворении мира, о прошлом и будущем Вселенной. Данные, полученные астрономическими обсерваториями, космическими телескопами и физическими лабораториями, стали твердой опорой для теоретической физики, несколько десятилетий подряд сражающейся за стройную, единую теорию поля, должную объединить все известные виды взаимодействий. По убеждению многих, это теория струн, положения и следствия которой развернуто толкуют профессоры Хокинг и Млодинов. Черная материя и черная энергия, о которых мы знаем лишь благодаря гравитационным эффектам, путешествия во времени, на которые, как считаю авторы, не стоит пока делать ставок - всё это оказалось в фокусе их внимания. Издание содержит 37 цветных иллюстраций, дополняющих и украшающих текст.','Научно-популярная литература','В наличии',400),(13,'Романтическая классика','Гордость и предубеждение','Книжковий Клуб Клуб Сімейного Дозвілля',2016,416,'18+','Блистательное произведение <<первой леди>> английской литературы, навсегда разрушившее предубеждение о романе как о жанре легкомысленном и далеком от правды жизни, с присущим писательнице тонким и искрометным юмором, вниманием к деталям и психологической достоверностью переносит нас в чопорную Британию начала ХІХ века, где предубеждения и гордость едва не стали препятствием в любви юной Элизабет Беннет и благородного мистера Дарси. Героям придется совершить массу нелепых ошибок, распутать паутину глупых интриг и семейных предрассудков, чтобы суметь услышать главное - голос сердца.','Художественная литература','В наличии',190),(14,'-','Українська легко!','Книжковий Клуб Клуб Сімейного Дозвілля',2016,288,'6+','Створено спільно з інтернет-ресурсом <<Мова – ДНК нації>>. За допомогою інфографіки показані правила та складні випадки вживання слів в українській мові. Українська без суржику, русизмів і кальок за допомогою інфографіки! Видання з наочними ілюстраціями та стислими правилами, прикладами вживання і корисними статтями. Цю книжку створено з мрією про те, що колись в Україні буде модно знати декілька мов, а говорити українською.','Учебная литература','В наличии',195);
