INSERT INTO `books_for_articles` VALUES (2,'\"Пока не остыл кофе\" Тосикадзу Кавагути','blog_images/post1_1.jpg','Какой ваш любимый напиток? А когда-нибудь вы хотели побывать в прошлом? Эти два вопроса очень разные, но есть на свете место, которое их объединяет - кафе, где варят очень особый кофе, из которого можно попасть в прошлое. Но надо соблюдать определенные правила: сидеть на «правильном» стуле и не вставать с него; встретиться можно только с теми, кто тоже был в кафе; - прошлого нельзя изменить ни в коем случае. И самое главное - находиться в прошлом можно до тех пор, пока не остынет кофе.'),(3,'\"Между небом и землёй\" Марк Леви','blog_images/post1_2.jpg','Архитектор Артур переехал в новую квартиру. Вечером он решил расслабиться и набрал в ванную воду. Это то, чего он ждал в течение целого дня. И вот Артур слышит, что кто-то поет. И звук раздается из ... шкафа. Он замер, тогда набрал в грудь воздуха и открыл шкаф. Знаете, что он там увидел? Или скорее кого? Женщину.\n\nПрекрасная незнакомка - Лорен, предыдущая жительница квартиры, в которую переселился Артур. И она - призрак. На самом деле женщина лежит в больнице в коме и его состояние настолько плохое, что Лорен должны отключить от аппарата жизнеобеспечения. Видеть женщину может только Артур.Конечно же, они влюбляются друг и друга.\n\n«Между небом и землёй» - хорошая и немного фантастическая история о любви, сострадании, дружбе. Помните, каждое утро мы получаем в кредит 86400 секунд, и только от нас зависит, как мы их используем.'),(4,'\"Если бы ты знал\" Эльчин Сафарли','blog_images/post1_3.jpg','Она - умирает. Да, конечно, мы все когда-нибудь умрем, но главная героиня книги «Если бы ты знал» знает, сколько времени у нее осталось. Немного. Но ей не страшно, наоборот - она решает изменить свою жизнь и стать счастливой.\n\nОна переехала в другой город. От знакомых улиц, зданий и магазинов. От всего, что могло ей напоминать о смерти. Она переехала, чтобы не видеть в глазах людей сожаления.\n\nКнига поднимает сложные темы жизни и смерти, поиска цели и смысла. О смелости принять все трудности, которые выпадают на долю, и умение наслаждаться каждым днем. Читается книга на удивление легко и оставляет замечательное послевкусие.'),(5,'\"Ловушка для золушки\" Себастьен Жапризо','blog_images/post1_4.jpg','Главная героиня очнулась в больнице. Почему она здесь? Кто она? Лицо в повязках. Где зеркало? Врачи говорят, что три месяца назад она обгорела в пожаре. Тогда она узнает, что их было двое: одна девушка виновата в пожаре, другая - нет. Одна девушка выжила, другая - умерла. Но сама девушка не помнит ничего. Кто же она на самом деле?\n\nДо последних страниц остается загадкой: было ли вообще совершено преступление и кто выжил - преступница или жертва?'),(6,'\"Кафе на краю мира\" Джон П. Стрелеки','blog_images/post1_5.jpg','Представьте себе, что вы заблудились. Обессиленные, голодные и раздраженные вы видите кафе со странным названием «Почему вы здесь?». Зашли бы или нет? Главный герой книги «Кафе на краю світу» зашел, потому что хотел есть и пить. Но получил гораздо больше, чем просто еду. Он задумался о смысле своей жизни, о своей миссии и о том, как хотел бы прожить свою жизнь. Три главные вопроса, которые он услышал в кафе, и ответ на которые должен найти каждый из нас:\n1. «Почему вы здесь?» (Самое сложное, правда?)\n2. «Боитесь ли вы смерти?»\n3. «Довольны ли вы?»\n\nКнига, вдохновившая миллионы людей во всем мире на большие изменения. И одновременно - это легкая история, которую можно прочитать за несколько часов.'),(7,'«Моими словами» Рут Бейдер Гинзберг','blog_images/post2_1.jpg','Рут Бейдер Гинзберг – известный американский правовой деятель, судья Верховного суда США, феминистка и защитница гендерного равенства. Она стала второй женщиной, получившей столь высокий пост в Верховном суде, и первой, прощание с которой состоялось в Капитолии. В биографии Гинзберг каждый найдет что-то свое: кто мотивацию и вдохновение, а кто новую порцию для размышлений.<br><br>В новой книге Рут Бейдер Гинзберг «Моїми словами», написанной с помощью Мэри Гартнетт и Венди У. Уильямз, все читатели смогут узнать принципы, идеалы и размышления известной судьи через ее выступления, речи и записки со школьных времен до последних лет жизни. Каждый сможет по-новому взглянуть на позицию Гинзберг и глубже погрузиться в темы гендерного равенства и дискриминации. Женщина посвятила справедливости всю свою жизнь и теперь уже после ее смерти книга стала доступна всему миру.'),(8,'\"Следующая пандемия\" Уильям Патрик','blog_images/post2_2.jpg','Черная смерть, испанка, эбола, птичий грипп, бубенная чума – за многие тысячелетия мир увидел множество опасных смертельных заболеваний, от которых погибали миллионы людей. В новой книге издательства «Манн, Иванов и Фербер» собраны соображения опытного врача Али Хана, который на своем пути неоднократно встречался с такими эпидемиями. Он провел свои исследования и предложил читателям размышления о причинах возникновения смертельных заболеваний, а также о том, как с ними бороться и какие меры предпринять, чтобы они больше никогда не повторились. <br><br>В новинке собран весь опыт доктора Хана. Он расскажет о своей работе с зараженными пациентами и моментах, когда от смерти его отделяли только тонкие маски и сетки. И в заключение Али Хан добавит свои рассуждения о COVID-19. Откровенные истории, от которых \"мурашки по коже\", не оставят равнодушным ни одного читателя.'),(9,'«Подолати минуле. Глобальна історія України» Ярослав Грицак','blog_images/post2_3.jpg','История нашей страны богата фактами и событиями, отважными и патриотическими личностями и уникальными произведениями искусства. Через десятки веков Украина прошла множество препятствий, пережила то, что сейчас даже тяжело укладывается в голове. Войны, восстания, героические походы, зарождение культуры и обычаев – все это наша история, которую мы должны помнить. <br><br>Новая книга от Ярослава Грицака, которую он писал целых 15 лет, наконец-то готова представить миллионам украинцев длинный и тяжелый рассказ о прошлом Украины. От Киевской Руси и Речи Посполитой до настоящего времени – читатель сможет узнать всю историю в деталях. Также в книге каждый найдет интересную и полезную информацию о названии «Украина», о давних традициях нашего народа и о том, как мы влияем на творение страны в наше время. Автор даст понять украинцам причину всего происходящего в государстве теперь и покажет наше возможное будущее.'),(10,'«Писать как дышать» Таис Золотковская','blog_images/post2_4.jpg','Искусство письма – очень тонкое и многогранное. Для того чтобы написать отличный текст, нужны не только совершенные навыки, но и вдохновение, свой особый стиль и самодисциплина. Где брать мотивацию и как усовершенствовать свои умения? Об этом расскажет в своей новинке, посвященной писательской деятельности, известная украинская авторка Таис Золотковская, перу которой принадлежат такие произведения, как «Червона сукня моєї тітки» и «Пиши. Легкий шлях від ідеї до книжки». <br><br>Книга создана для того, чтобы каждый, кто планирует хоть как-то увязать свою жизнь с письмом, мог набраться вдохновения и мудрых советов, которые помогут улучшить разные навыки. Интерактивная составляющая пособия раскроет все грани творчества читателей, побуждает к ежедневному развитию в этой сфере и позволит увидеть этот мир по-новому. В книге вы также найдете заметки и подчеркивания, которые еще больше перенесут вас в творческую и художественную атмосферу.');
