INSERT INTO `news` VALUES ('2022-01-21 09:42:58','Купи 3 книги из категории Саморазвитие по цене 2!','news_images/news1.jpg','С 1 июня стартует акция: приобрети 2 книги из категории Саморазвитие по цене 1! Приглашаем всех желающих принять участие в нашей акции! Ведь всем тем, кто собирается на отдых в летнюю пору, не стоит забывать и о развитии собственной личности. Поэтому поспешите!Акция действует с 01.06.2021 по 14.06.2021'),('2022-04-13 19:28:04','Акция 2 + 1!','news_images/news2.jpg','Купи 2 книги из жанра Художественная литература и получи любую нашу книгу в подарок. Примечание: стоимость подарочной книги должна быть меньше стоимости любой из двух купленных книг. Акция действует с 13.04.2022 по 13.05.2022. Спешите приобрести!');
