CREATE DEFINER=`Mariia`@`localhost` PROCEDURE `change_order_total_cost_after_adding_book`(orderId INT)
BEGIN
	DECLARE sumCost INT DEFAULT 0;
    DECLARE tempCost INT;
    DECLARE num INT;
    DECLARE done INT DEFAULT FALSE;
    DECLARE cur1 CURSOR FOR SELECT order_details.cost_of_book, order_details.number_of_books FROM order_details WHERE order_details.order_id = orderId;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    
    OPEN cur1;
    WHILE done = FALSE DO
		FETCH cur1 INTO tempCost, num;
        IF done = FALSE THEN
			SET sumCost = sumCost + (tempCost * num);
		END IF;
	END WHILE;   
    CLOSE cur1;

    UPDATE book_order SET total_cost = sumCost WHERE book_order.order_id = orderId;
END ;;
